import React from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import TextField from '@material-ui/core/TextField';

import SelectSeats from './select-seats';
import SelectDateTime from './select-date-time';
import SelectСoutry from './select-date-time';
import './table-book-bar.css'

export default class FormDialog extends React.Component {
  state = {
    open: false,
    seats: '1'
  };
  handleClickOpen = () => {
    this.setState({ open: true });
  };

  handleClose = () => {
    this.setState({ open: false });
  };
  handleChange = event => {
    if(event.target.value > 0)
    this.setState({ [event.target.name]: event.target.value });
  };
  render() {

    return (
      <div>
        <Button onClick={this.handleClickOpen}>Filters</Button>
        <Dialog
          open={this.state.open}
          onClose={this.handleClose}
          aria-labelledby="form-dialog-title"
        >
          <DialogTitle id="form-dialog-title">Book table</DialogTitle>
          <DialogContent className='dialog-elements'>

            <SelectSeats />
            <SelectDateTime />
            <SelectСoutry />
              <TextField
        id="standard-number"
        label="Number"
        value={this.state.age}
        onChange={this.handleChange}
        type="number"
        InputLabelProps={{
          shrink: true,
          name: "seats"
        }}
        margin="normal"
      />

          </DialogContent>
          <DialogActions>
            <Button onClick={this.handleClose} color="primary">
              Cancel
            </Button>
            <Button onClick={this.handleClose} color="primary">
              Ok
            </Button>
          </DialogActions>
        </Dialog>
      </div>
    );
  }
}
